export default function sizes(){
    const sizeList = [
        {
            name:'XS'
        },
        {
            name: 'S'
        },
        {
            name: 'M'
        },
        {
            name: 'L'
        },
        {
            name: 'XL'
        }
    ];

    return(
        sizeList.map((size, key) => 
            <div>{size.name}</div>
        )
    );
}
